description:
नेपाली कांग्रेसको विशेष महाधिवेशन काठमाडौंको भृकुटीमण्डपमा जारी छ ।&amp;nbsp;

महाधिवेशनको उद्घाटन सत्रलाई नेताहरूले सम्बोधन गरिरहेका छन् भने अर्कोतिर प्रतिनिधिहरूको नाम दर्ता समेत चलिरहेको छ ।

दिउँसो ४ बजेसम्म करिब ५० प्रतिशत महाधिवेशन प्रतिनिधिले

कपिलवस्तुको&amp;nbsp;कृष्णनगरबाट&amp;nbsp;१ थान&amp;nbsp;भरुवा बन्दुकसहित १ जना पक्राउ परेका छन् ।

कपिलवस्तुको&amp;nbsp;कृष्णनगर नगरपालिका १२ नरैनापुर बस्ने ४२ वर्षीय विनोद ओझालाई शनिबार साँझ पक्राउ गरिएको प्रहरीले जनाएको छ ।

इलाका प्रहरी&amp;nbsp;

नेपाली कांग्रेसको विशेष महाधिवेशन आइतबार दिउँसो काठमाडौंमा शुरू भएको छ ।&amp;nbsp;

भृकुटीमण्डपमा &amp;zwj;जारी महाधिवेशनलाई महामन्त्रीद्वय गगन कुमार थापा र विश्वप्रकाश शर्माले संयुक्त रूपमा उद्घाटन गरे ।

गगनले पानसमा बत्ती बालेर र विश्वप्रकाशले रुख
